import { ref, onValue } from "firebase/database";
import { useEffect, useState } from "react";
import { database } from "../../config/Firebase/firebase";

const Appointment = () => {
  const [Appointment, setAppointment] = useState({});
  const [Info, setInfo] = useState({});
  const [appointmentImage, setAppointmentImage] = useState({}); // Untuk gambar

  useEffect(() => {
    const AppointmentRef = ref(database, "Appointment/");
    onValue(AppointmentRef, (snapshot) => {
      const data = snapshot.val();
      setAppointment(data);
    });
    const InfoRef = ref(database, "Info/");
    onValue(InfoRef, (snapshot) => {
      const data = snapshot.val();
      setInfo(data);
    });

    const appointmentImageRef = ref(database, "appointmentImage/");
    onValue(appointmentImageRef, (snapshot) => {
      const data = snapshot.val();
      setAppointmentImage(data);
    });
  }, []);
  return (
    <div className="container-xxl py-5">
      <div className="container">
        <div className="row g-5">
          <div className="col-lg-6 wow fadeInUp" data-wow-delay="0.1s">
            <p className="d-inline-block border rounded-pill py-1 px-4">
              Appointment
            </p>
            <h1 className="mb-4">{Appointment.title}</h1>
            <p className="mb-4">{Appointment.paragraph}</p>
            <div className="bg-light rounded d-flex align-items-center p-5 mb-4">
              <div
                className="d-flex flex-shrink-0 align-items-center justify-content-center rounded-circle bg-white"
                style={{ width: 55, height: 55 }}
              >
                <img
                  src={`data:image/jpeg;base64, ${appointmentImage.callUs}`}
                  alt="Call Us"
                  style={{
                    width: "30px",
                    height: "30px",
                    borderRadius: "50%",
                  }}
                />
              </div>
              <div className="ms-4">
                <p className="mb-2">Call Us Now</p>
                <h5 className="mb-0">{Info.telepon}</h5>
              </div>
            </div>

            <div className="bg-light rounded d-flex align-items-center p-5">
              <div
                className="d-flex flex-shrink-0 align-items-center justify-content-center rounded-circle bg-white"
                style={{ width: 55, height: 55 }}
              >
                <img
                  src="/img/EmailUs.png"
                  alt="Mail Us"
                  style={{
                    width: "30px",
                    height: "30px",
                    borderRadius: "50%",
                  }}
                />
              </div>
              <div className="ms-4">
                <p className="mb-2">Mail Us Now</p>
                <h5 className="mb-0">{Info.email}</h5>
              </div>
            </div>
          </div>
          <div className="col-lg-6 wow fadeInUp" data-wow-delay="0.5s">
            <div className="bg-light rounded h-100 d-flex align-items-center p-5">
              <form>
                <div className="row g-3">
                  <div className="col-12 col-sm-6">
                    <input
                      type="text"
                      className="form-control border-0"
                      placeholder="Your Name"
                      style={{ height: 55 }}
                    />
                  </div>
                  <div className="col-12 col-sm-6">
                    <input
                      type="email"
                      className="form-control border-0"
                      placeholder="Your Email"
                      style={{ height: 55 }}
                    />
                  </div>
                  <div className="col-12 col-sm-6">
                    <input
                      type="text"
                      className="form-control border-0"
                      placeholder="Your Mobile"
                      style={{ height: 55 }}
                    />
                  </div>
                  <div className="col-12 col-sm-6">
                    <select
                      className="form-select border-0"
                      style={{ height: 55 }}
                    >
                      <option selected>Choose Doctor</option>
                      <option value={1}>Doctor 1</option>
                      <option value={2}>Doctor 2</option>
                      <option value={3}>Doctor 3</option>
                    </select>
                  </div>
                  <div className="col-12 col-sm-6">
                    <div className="date" id="date" data-target-input="nearest">
                      <input
                        type="text"
                        className="form-control border-0 datetimepicker-input"
                        placeholder="Choose Date"
                        data-target="#date"
                        data-toggle="datetimepicker"
                        style={{ height: 55 }}
                      />
                    </div>
                  </div>
                  <div className="col-12 col-sm-6">
                    <div className="time" id="time" data-target-input="nearest">
                      <input
                        type="text"
                        className="form-control border-0 datetimepicker-input"
                        placeholder="Choose Date"
                        data-target="#time"
                        data-toggle="datetimepicker"
                        style={{ height: 55 }}
                      />
                    </div>
                  </div>
                  <div className="col-12">
                    <textarea
                      className="form-control border-0"
                      rows={5}
                      placeholder="Describe your problem"
                      defaultValue={""}
                    />
                  </div>
                  <div className="col-12">
                    <button
                      className="btn btn-primary w-100 py-3"
                      type="submit"
                    >
                      Book Appointment
                    </button>
                  </div>
                </div>
              </form>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Appointment;
